import { render } from "@testing-library/react";
import React, { Fragment } from "react";
import Card from "./card";
import "./home.css";
class Home extends React.Component {
  render() {
    return (
      <Fragment>
        <div className="title-container margin">
          <h1 className="title">Lautaro Nasello</h1>
          <h2 className="subtitle center">Frontend Web Developer</h2>
        </div>
        <div className="card-group">
          <Card section="About" text="Something about my personal life" />
          <Card section="Knowledge" text="My knowledge from new tecnologies" />
          <Card
            section="Experience"
            text="My experience and learnig achademys"
          />
          <Card section="Projects" text="Personal projects running " />
          <Card section="Contact" text="Social Media to chat me" />
        </div>
      </Fragment>
    );
  }
}

export default Home;
